INSERT INTO `ffsm_whjk` VALUES ('1', '金', '气管炎、支气管炎、肩背病、鼻病、皮肤病等。', '咳嗽、喘闷、胸痛、短气、肩背痛、咽痛、声嘶、鼻塞、便秘、水肿、小便不利、骨节痛、皮肤病等。', '养生要点：肺在五行属金，故金型人偏于肺气虚，需要注意的是肺和大肠，其次是气管及整个呼吸系统。中医认为，人体五脏与自然界四时相应，燥为秋天的主气，而肺为清虚之体，秋燥最易伤肺，金型人为阴阳相对平之人，但是金型人多有肺脏方面疾病的易感性。因而金型人体质的女性要特别注重肺肾两脏的保养。', '生活起居：锻炼身体提高身体免疫力，改善通风环境，保持空气清新，以抵御和预防呼吸系统的疾病发生。平时宜多饮水，以保持皮肤及体内水分的充足。悲属金，与肺同源，过度悲伤就会造成损伤肺气，故金型人应保持心情愉快避免过度悲伤的情绪发生。', '饮食调养：饮食应以清肺润肺、生津增液之品为主，因其还能促进肠胃蠕动，促进新陈代谢，让肌肤充满弹性与光泽。金型人宜多食植物性食物，如百合、梨、苹果、银耳、梗米、无花果、菌类、山药、白萝卜、豆腐、鸡肉、鲢鱼等。', '保健膳食：百合粥——百合40克，梗米加水适量煮粥，粥将成时加入冰糖，稍煮片刻即可。此粥对于金型人体质的女性有较好的恢复容颜的作用。');
INSERT INTO `ffsm_whjk` VALUES ('2', '木', '肝胆疾病、脑病、眼病、筋骨病等。', '肋痛、头痛、筋骨疼痛、视物不清、头晕目眩等。', '肝在五行属木，故木型人体质偏于肝郁气滞，要注意的器官是肝与胆，其次是筋骨和四肢，木型人多具有肝、胆及神经精神系统的潜在易感性。养生重点在理阴助阳，调理好心肝二脏。工作过于辛苦者第一要维护的就是肝脏，而且过怒也会伤肝。因此，木型人体质的女性宜保持性格开朗，情绪平和是非常重要的。平时可多进食舒肝活血的食物。<br />\r\n', '宜多参加体育锻炼及旅游活动，因体育锻炼和旅游活动均能运动身体，流通气血。既欣赏了自然美景，调剂了精神，呼吸了新鲜空气，又能沐浴阳光，增强体质。', '饮食上要注意舒肝理气，可多吃木瓜、萝卜、菊花茶、橙子、柑皮、韭菜、胡萝卜、白菜、大蒜、山楂、猪蹄等食物。至于寒凉、油腻、粘滞的食物，则应尽量少吃。', '银杞菊花粥——银耳、菊花各10克。同放锅内，加水适量煮粥，粥熟后，待粥降温后调入蜂蜜即可食用。常服此粥有养肝、补血、明目、润肤、祛斑增白之功。<br />\r\n');
INSERT INTO `ffsm_whjk` VALUES ('3', '水', '肾脏病、腰腿病、脑髓病，咽喉、生殖系统病等。', '腰痛、水肿、腹泻、耳鸣、关节痛、咽喉病，女性各种妇科疾病。', '肾在五行属水，故水型人体质偏于肾阳虚。要注意的人体重要器官是肾与膀胱，其次是脑与泌尿生殖系统。水型人由于是冬天出生的，身体内阴气盛而阳气多偏不足，所以水型人多具有阳虚阴寒疾病及肾脏方面疾病的潜在易感性。比如水肿、腰痛、不孕症等疾病。因此，水型人养生的关键在于温阳益气，注重补阳气。宜热食、辣椒、胡椒、牛羊肉。忌粘硬、生冷之品。', '肾阳虚体质的水型人，适应气候的能力较差，冬季要避寒就温，注意保暖，春夏要注意培补阳气，提高冬季的耐寒能力。要积极参加各种球类运动和跑步锻炼，适当参加体力劳动。“动则阳气生”以达到生阳去阴的效果。', '宜多动物性食物，壮阳食品。如羊肉、狗肉、鸡肉、鹿肉等，以壮阳气之功。更应该多吃黑色食物，经常吃能帮助和肾、膀胱、骨骼关系密切的新陈代谢功能正常，使多余水分不至于积存在体内造成水肿。', '芝麻核桃粥——芝麻30克，核桃仁30克，与糯米同放锅内，加水适量煮粥。常食此粥能帮助毛发生长发育，使皮肤变得洁白、丰润。\r\n\r\n');
INSERT INTO `ffsm_whjk` VALUES ('4', '火', '心脏病、皮肤病、脑溢血等。', '心慌、失眠、水肿、皮肤病、自汗盗汗、视物不清、小便涩痛、关节酸痛等。', '心在五行属火，火型人体质偏于心阴虚火旺。主要表现为心烦失眠、口渴、舌质红等特点。火型人身体内阳气比较旺盛，养生的关键在于滋阴抑阳，调养心肾，以水济火。火型人要注意的人体器官是心脏与小肠，其次是血脉及整个循环系统。火型人有易患热病、血症及暴病的潜在倾向。比如冠心病、动脉硬化、脑溢血等疾病。火型体质人最重要的是养心，除了多吃养生食物之外，冬季好好补养肾气是个不错的方法。\r\n', '阴虚者，畏热喜寒，寒冬易过，热夏难当。每逢春夏季，可到海边、林区、山区去旅游休假。\r\n', '养心最好吃些赤色食物，其原则要保阴潜阳，多吃清淡食物，以清淡之品为宜。如糯米、芝麻、蜂蜜、乳品、豆腐、鱼、蔬菜、水果等。有条件的人可食用一些海参、龟肉、蟹肉、银耳、雄鸭、冬虫夏草等。燥热辛辣之品则应少吃。', '莲子龙眼粥——龙眼莲子肉各30克，糯米100克，加水烧沸，再改为小火慢慢煮至米粒烂透即可，常服此粥可养心补血，润肤养颜。\r\n');
INSERT INTO `ffsm_whjk` VALUES ('5', '土', '脾胃病、口齿病、肌肉疾病等。', '腹胀、腹痛、腹泻、便秘、黄疸、乏力、口舌溃疡等。\r\n', '脾在五行属土，土型人体质偏于脾胃虚弱，所以土型人易患脾胃消化方面的疾病。土型人要注意的人体器官是脾与胃，其次是肠及整个消化系统。养生的重点是阴阳并重，形神兼养，综合饮食，脾胃调理好了，气血才会旺盛。土型人要多吃健脾的食物，至于寒凉、油腻、粘滞等易伤脾胃阳气的食物，则应尽量少食。', '生活一定要有规律，保持情绪稳定，进食不宜过急过饱。', '应该多吃健脾利湿的食物，如白萝卜、扁豆、包菜、洋葱、紫菜、白果、大枣、山药、糯米、牛肉、红小豆等。少食肥甘厚味、饮料、酒类之品，且每餐不宜过饱。', '红枣茯苓粥——大红枣20枚，茯苓30克，梗米100克。将红枣洗净剖开去核，茯苓捣碎，与梗米共煮成粥，常食此粥可滋润皮肤，增加皮肤弹性和光泽，起到养颜美容作用。');
INSERT INTO `sm_81` VALUES ('1', '（太极之数）太极之数，万物开泰，生发无穷，利禄亨通。', '大吉', '大吉运', '天地开泰万事成，身体康安亦富荣，否泰名誉兼享福，一生无忧乐绵长。繁荣发达，信用得固，万人仰望，可获成功。万物开泰，最大吉祥的暗示，但常人恐不当。天地开端?万物创始之象?威望?长寿之运格?有独立?单行?健全?发达?富贵?名誉?幸福?长寿等暗示力?宜静不宜动?静可得良机?如旭日东升?以温和步骤?可获得成功?事半功倍?但对常人恐有过好?不堪当之之数也。（吉）天地开端创始之象，有始收，富贵，长寿，乃为大吉之数，但宜静不宜动，静可得良机，如旭日东升，以温和步伐，可获大成功，健康，荣华，名誉，终生幸福之命运也。因数过好恐常人不堪当之。「天地开泰」', '1');
INSERT INTO `sm_81` VALUES ('2', '（两仪之数）两仪之数，混沌未开，进退保守，志望难达。', '大凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等） ', '未定的分离破灭数，混沌未定，为最大凶恶的暗示。\r<BR>诗曰：混浊未定如萍动，乱离不安亦波浪，独立无力多灾难，变动病弱又短命。\r<BR>\r<BR>一身孤节，属末定的分离破灭数。（大凶）\r<BR>基业：劫财、破灭、灾危、破家、红艳、变迁、美貌。\r<BR>家庭：亲情疏远、夫妻应相互理解、则免别离之苦。\r<BR>健庭：凶弱、短亦有之，易患皮肤病外伤、矢折。\r<BR>含义：混沌末定数。为最大凶恶的暗示，无独力之气力进退失自由、其内外生波澜因苦不安。摇动、病患遭难，甚至残废。如伴有其他好数者不致夭折，其人辛苦一生，志望难达破灭无常。', '2');
INSERT INTO `sm_81` VALUES ('3', '（三才之数）三才之数，天地人和，大事大业，繁荣昌隆。　', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>吉祥运（表示健全、幸福、名誉等）', '进取如意的增进繁荣数，成功发达之兆，名利双全。\r<BR>诗曰：进取如意又富贵，知达明敏扬名威，名利寿福可安宁，前途光芒好鸿图。\r<BR>\r<BR>吉祥，进取如意的增进繁荣数。（大吉）\r<BR>基业：术、技艺、祖业、丰盛自立、建业官禄。\r<BR>家庭：家内施惠，可得贤妻六亲和睦须戒自私。\r<BR>健康：松柏林立，健康良好，可望长寿。\r<BR>含义：阴阳抱合，万物确定形成之象，有吉祥、成功发达之兆。智达明敏，艺精工巧有首领之资，自然之福。名利双全能成大事业，荣进有望，福祉无穷。', '3');
INSERT INTO `sm_81` VALUES ('4', '（四象之数）四象之数，待于生发，万事慎重，不具营谋。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）\r<BR>孤独运（妻凌夫或夫克妻）', '万事休止数，不足不全如同画饼充饥。\r<BR>诗曰：溯体凶变不具整，残废病难兼夭折，破家亡身招灾祸，苦苦之中有孝人。\r<BR>\r<BR>凶变，身遭凶变的万事休止符。（凶）\r<BR>基业：美貌、香艳、破家、灾危、劫财；损家业。\r<BR>家庭：六亲缘薄、兄弟如同画饼，热心相助者少。应看开一些。\r<BR>健康：衰弱，外伤，皮肤病，夭折病死，发狂病。\r<BR>含义：属破坏的凶就数，不足不全的灭亡之数。进退不自由，独立乏能力。大多辛苦困难，或者与其他凶运配合而致发狂病死，夭折。或者放浪，破灭，逆难终成废人。但孝子、节妇、怪杰等，也有出自此数者。', '4');
INSERT INTO `sm_81` VALUES ('5', '（五行之数）五行俱权，循环相生，圆通畅达，福祉无穷。', '大吉', '吉祥运（表示健全、幸福、名誉等）\r<BR>男性双妻运\r<BR>温和运（性情平和、能得上下信望）', '福禄长寿，阴阳和合、完壁之象，最大吉数。\r<BR>诗曰：福禄寿长阴阳和，心身健全是英豪，名利双收富荣达，乃是世上福德人。\r<BR>\r<BR>种竹成林、福禄长寿的福禄集合数。（大吉）\r<BR>基业：学者、祖业、文昌、福星、官星、财钱。\r<BR>家庭：上下和睦，相互合作，可望圆满，子女多荫。\r<BR>健康：福禄如海，寿比南山。可望健康。\r<BR>含义：阴阳交感，和合，完璧之象，隐藏大成功运。精神敏锐，身体健全，福禄长寿，富贵繁荣，无所不至或为中兴之祖，或在他乡成家，或复兴绝家。即或不如此，也会博得功名荣誉，圆满无碍福祉祯祥无比。', '5');
INSERT INTO `sm_81` VALUES ('6', '（六爻之数）六爻之数，发展变化，天赋美德，吉祥安泰。　', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）\r<BR>男性双妻运\r<BR>温和运（性情平和、能得上下信望）', '吉人自有天相数，逢凶化吉不在话下。\r<BR>诗曰：安稳余庆福禄开，盛大幸福天赐来，内含衰兆就谨慎，天乙贵人守身边。\r<BR>\r<BR>安稳吉庆的吉人天相数。（半吉）\r<BR>基业：豪杰、官禄、财钱、将星、学者。\r<BR>健康：逢凶化吉，遇一次生险，可得长寿。\r<BR>含义：天德地祥具备，福庆甚广，家势盛大万宝朝宗之运然满极必损，盈极必亏，若其他要素配合的不周者，恐或如流水而下，成为所谓乐极生悲之象，此数理具有天赋之美，安稳吉庆终生。', '6');
INSERT INTO `sm_81` VALUES ('7', '（七政之数）七政之数，精悍严谨，天赋之力，吉星照耀。　', '吉', '吉祥运（表示健全、幸福、名誉等）\r<BR>刚情运（性刚固执、意气用事）', '刚毅果断、勇往直前，精力充足，排除万难。只是应涵养量。\r<BR>诗曰：刚毅果断除万难，独立权威志气安，内外和好兼柔性，温和养德耀吉星。\r<BR>\r<BR>精悍，刚毅果断勇往直前的进取数。（吉）\r<BR>基业：独立、官禄、进取、技术、刚硬。\r<BR>家庭：缺乏同心力，内外不合，善涵养修身者事得家庭圆满。\r<BR>健康：日月光明，心身健保，可望长寿。\r<BR>含义：独立、单行、极感之象，过刚而缺乏同化力之意。如果顽刚弄权，易酿成内外不和，幸而天赋的精力充沛，具有调节事物的才能，能够粉碎硬敌，排除万难，若能涵养雅量，扩大气度自然幸福上进，女性有此数者，难免有男性之情性，切要注意温和才会吉利而无过失。', '7');
INSERT INTO `sm_81` VALUES ('8', '（八卦之数）八卦之数，乾坎艮震，巽离坤兑，无穷无尽。　', '吉', '吉祥运（表示健全、幸福、名誉等）', '意志刚键、勤勉发展、富于进取的气概。性直。\r<BR>诗曰：意志刚强善恶明，富进取心求和平，忍耐克己如心意，前难后成可安然。\r<BR>\r<BR>坚刚，志刚意健的勤勉发展数。（吉）\r<BR>基业：艺能、美术、学者、官禄、天官、师表、蓄产。\r<BR>家庭：兴家成为达人贤者，家境先难后易。\r<BR>健康：高山立松完健自在，可望长寿。\r<BR>含义：意志如铁石，富于进取的气概。排除万难，贯彻目的名利两得，忍耐克己逐成大功。但其他运配合不善者，可能有遭难的厄运。', '8');
INSERT INTO `sm_81` VALUES ('9', '（大成之数）大成之数，蕴涵凶险，或成或败，难以把握。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '吉尽凶始，穷乏之数。有不测灾祸，实为人生最大恶运。\r<BR>诗曰：与尽凶始入困途，窘迫病难失亲和，灾害短命无所止，生离死别却哀悲。\r<BR>\r<BR>破舟进海，吉尽凶相，穷乏之数。（凶）\r<BR>基业：官禄、图印、太极、怪杰、富翁、突破。\r<BR>家庭：亲情不睦，口说长短者多，力持贤明者平安。\r<BR>健康：女性成风流或与夫别离病弱，弱女皆晚婚。多积德可免短命。\r<BR>含义：利去劫空，陷落穷迫、逆运、短命，悲痛或者幼小离亲而困苦，或者病弱，不遇，遭难废疾，贫困，灾难，孤独甚至刑罚。有不测遇凶祸，人格有此数者则为大凶，即或一身得免灾害。也难免配偶丧失。有缺子之叹。实为人生最大恶运但也有例外的怪杰，富豪能出此数者。', '9');
INSERT INTO `sm_81` VALUES ('10', '（终结之数）终结之数，雪暗飘零，偶或有成，回顾茫然。　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）\r<BR>孤独运（妻凌夫或夫克妻）', '万物终局，充满损耗数，大凶，不宜使用。\r<BR>诗曰：万事终局万事空，逆难失意逢空亡，病弱短命多暗淡，克夫伤子破家风。\r<BR>\r<BR>零暗，万业终局充满损耗数。（凶）\r<BR>基业：天福、文昌、散财、官禄、破危、矢寿。\r<BR>家庭：家内总是冷眼旁观者多，伤害妻子破镜难圆、百忍者尚可平安。\r<BR>健康：杀伤刑罚，病弱、灾危、女易风流。心性变态。\r<BR>含义：境地悲凄，空虚无物，人格有此数者，多灾短命。如同日没，四顾茫茫，神哭鬼嚎凶之象，行万象乏气力，常陷于不如意，凡要求功，因多障碍渐自失败，遂致破家亡户；或者贫困逆难叠至，无眷属之缘，或者自幼失亲，或者病弱，遭难，或者有不测之灾祸；或者犯官府等，难免非业非运。三才配合不得其宜者，大都中年后编进黄泉之籍。然万人中有一二例外，可绝处逢生。', '10');
INSERT INTO `sm_81` VALUES ('11', '（旱苗逢雨）万物更新，调顺发达，恢弘泽世，繁荣富贵。　', '大吉', '吉祥运（表示健全、幸福、名誉等）\r<BR>温和运（性情平和、能得上下信望）', '旱苗逢雨、枯木逢春。得挽回家运的最大吉数。\r<BR>诗曰：挽回家运矣春光，顺调发展财辉煌，温和笃实阴阳合，稳健顺序得人望。\r<BR>\r<BR>早苗逢雨，挽回家运的春成育数。（大吉）\r<BR>基业：财星。天佑、暗禄、文昌、技艺、田宅。\r<BR>家庭：养蜂结蜜，事事和顺，处处温和。\r<BR>健康：河川永在，可望健康长寿。\r<BR>含义：享天赋幸运，万事顺利，有得富贵荣誉，再兴家的暗示，得挽回家运平静和顺的最大吉数。', '11');
INSERT INTO `sm_81` VALUES ('12', '（掘井无泉）无理之数，发展薄弱，虽生不足，难酬志向。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）\r<BR>孤独运（妻凌夫或夫克妻）', '意志脆弱、家庭寂寞，企图不顾薄弱之力做无能力的事多失败。\r<BR>诗曰：意志薄弱不伸长，易招失败遇灾殃，家属缘薄孤独命，安居守分保平安。\r<BR>\r<BR>掘井无泉，意志脆弱，家庭寂寞数。（凶）\r<BR>基业：凶星、破厄、劫财、时禄。\r<BR>家庭：亲情如秋水，骨肉似寒炭，施恩招怨。宜提高气节健康：枯木待春，小心神经衷弱，骨癌之疾、外伤、皮肤病，三才良者可安全。\r<BR>含义：有无理伸张之象，不顾脆弱之力，企图做无能力做的事，多失败。遇事易生足之心。家庭无缘，孤独、遇难、逆境、病弱、不如意、困难等，又可因其他运配合而导致意外的失败，甚至有不能完寿的悲运。', '12');
INSERT INTO `sm_81` VALUES ('13', '（春日牡丹）才艺多能，智谋奇略，忍柔当事，鸣奏大功。', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>艺能运（富有艺术天才，对审美、艺术、演艺、体育有通达之能）', '智勇超群的大成功数，充满智慧是其特点。\r<BR>诗曰：智略超群博学多，善事事路亦忍和，功业成就得富荣，艺才相身乐千锺。\r<BR>\r<BR>智能超群的成功数。（大吉）\r<BR>基业：大官、文昌、技艺、进财、学士、田产、财库。\r<BR>健康：可能健全长寿、先天五行不和者不遇。\r<BR>含义：富学艺才能，有智谋奇略，忍柔当事，任何难事皆巧于奏大功。为得享福贵荣华的好诱导，充满智满是其特点。(by senlon)', '13');
INSERT INTO `sm_81` VALUES ('14', '（破兆） 家庭缘薄，孤独遭难，谋事不达，悲惨不测。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）\r<BR>艺能运（富有艺术天才，对审美、艺术、演艺、体育有通达之能）\r<BR>孤独运（妻凌夫或夫克妻）', '沦落天涯、失意烦闷数，家庭缘薄，多破兆。\r<BR>诗曰：沦落天涯失古恃，家族缘薄又克儿，寂寞类闷多灾厄，己身浮沈无可樨。\r<BR>\r<BR>沦落天崖的失意烦闷的数。（凶）\r<BR>基业：暗禄、美貌、艺术、流浪、红舞、劫财。\r<BR>家庭：骨肉疏远。离祖迁居。自家兄弟全无分、外处事又能缘。\r<BR>健康：男女均属好貌、皮肤病、感胃、风郁，先天五行相含有健康。\r<BR>含义：多破兆，家属缘溥。丧亲、丧子、兄弟姐妹分离孤独，不如意，烦闷，危难，遭厄，浮沉不定，为了慷慨。施惠招怨，劳而无功，凄惨孤独，其他好运者不多，有伤夭寿。', '14');
INSERT INTO `sm_81` VALUES ('15', '（福寿） 福寿圆满，富贵荣誉，涵养雅量，德高望重。', '大吉', '富贵运（多钱财、富贵、白手可获巨财）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>男性双妻运\r<BR>温和运（性情平和、能得上下信望）', '最大好运，福寿圆满之象。\r<BR>诗曰：福寿拱照德望高，财子寿全又温和，慈祥好善可恭敬，富贵繁荣得惠泽。\r<BR>\r<BR>福寿共照的立身家数。（大吉）\r<BR>基业：天官，贵人，福星、官禄、进田、畜产。\r<BR>家庭：清静家田，园满之象子孙昌盛。\r<BR>健康：海底明珠，安稳徐庆，健康自如。\r<BR>含义：此数为最大好运，福寿园满之象，顺和、雅量。多受福泽，德高望重，自成大业，富贵荣华，吉祥有德，繁荣兴家的大吉数。', '15');
INSERT INTO `sm_81` VALUES ('16', '（厚重） 厚德载物，安富尊荣，财官双美，功成名就。', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>富贵运（多钱财、富贵、白手可获巨财）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>男性双妻运\r<BR>温和运（性情平和、能得上下信望）', '反凶化吉象，得助，可成大业，富贵发达的好预兆。\r<BR>诗曰：贵人得助天乙扶，为人之上有财富，众望所归事业成，不可贪色保安宁。\r<BR>\r<BR>兴家得助的贵数。（大吉）\r<BR>基业：天官、贵命、家杰、进田、学士、豪侠、基产。\r<BR>家庭：春日花开，可望家庭圆满，男子有贤妻，女子不宜早婚。\r<BR>健康：花草逢春，贵弱于色情，戒慎者可望安康。\r<BR>含义：反凶化吉象。成首领，占上风，雅量厚重，豪侠足智多谋，善于协调，集名望。能服从，为大事大业可成，富贵发达的好表示。', '16');
INSERT INTO `sm_81` VALUES ('17', '（刚强） 权威刚强，突破万难，如能容忍，必获成功。　', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）\r<BR>刚情运（性刚固执、意气用事）', '权威刚强，有己无人，以至于与人不和，如避开此短处则为大吉。\r<BR>诗曰：突破万难权威高，刚性固执如英豪，须事谨慎守和平，可得大功福绵绵。\r<BR>\r<BR>突破万难的刚柔兼备数。（半吉）\r<BR>基业：天宫、将星、威武、艺术、文明。\r<BR>家庭：女性若能教养女德，贤慧者可望园满。\r<BR>健康：心身健康，可望长寿。\r<BR>含义：权威刚强，有已无人，以至与人不和，如善于避开此短处，则为大吉。意志坚定，具突破万难的气节是其最大的优点。如过于无理任性，恐反成失败，如果立志勇往向前，必成功而建大业。若陷过刚而变固执，必招厄患，切要警戒。妇女有此数者易流于男性化，如果能涵养女德，存心温和，福禄自然随之。但先天条件弱的妇女，反要用此数为妥。', '17');
INSERT INTO `sm_81` VALUES ('18', '（铁镜重磨）权威显达，博得名利，且养柔德，功成名就。', '大吉', '吉祥运（表示健全、幸福、名誉等）\r<BR>艺能运（富有艺术天才，对审美、艺术、演艺、体育有通达之能）\r<BR>刚情运（性刚固执、意气用事）', '有志竟成的内外吉数，一旦立志必排除万难，博得名利。但自我心过强。\r<BR>诗曰：有志竟成事皆通，智谋发展有威望，过刚遭难咸柔德，博得名利大成功。\r<BR>\r<BR>有志竟成的内外吉数。（大吉）\r<BR>基业：将星、文昌、太极、畜产，财帛，技艺。\r<BR>家庭：有祖宗荫庇之。心慈口硬，宜守和不可望园满。\r<BR>健康：心身健全如万年蛇，可望长寿。\r<BR>含义：铁石心发达运具备，有权力、智谋。志向一立，必破诸难，博得名利。但自我心强，乏包涵力。要戒坚刚，诱发非难。宜养柔德，且惧险勿临，则目的贯彻，功名成就。', '18');
INSERT INTO `sm_81` VALUES ('19', '（多难） 风云蔽日，辛苦重来，虽有智谋，万事挫折。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '有智谋，有兴大业博名利的实力，但每每发生意外障碍，内外不和、困难不绝，如其他格不吉，也有短命的可能。\r<BR>诗曰：风云蔽月未得安，虽有智慧做事难，孤独多难无所至，内外不和失妻儿。\r<BR>\r<BR>遮云蔽月的辛苦重来数。（凶）\r<BR>基业：官禄、进田、经艳、财帛、智谋、凶危破财。\r<BR>家庭；家内朝思幕致，兄弟成吴越，须思手足情应多注意。\r<BR>健康：风云蔽月，病弱、刑罚、杀伤、短命，先天五行属金水者可望安康。\r<BR>含义：有多智谋，虽有兴大业，博得名利的实力，但每发生意外的陷害，内外不和，困难苦惨不绝。如果主运有此数又乏其他吉数以相助，多陷病弱，孤寡。甚至有夭折，妻子死别，刑罚。杀伤等灾。为万事挫折非命至极。故也叫短命数。但先天有金者，可成巨富，怪杰，伟人。', '19');
INSERT INTO `sm_81` VALUES ('20', '（屋下藏金）非业破运，灾难重重，进退维谷，万事难成。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '非业空虚，泥身进海，难以为继，有物将坏这象，最大凶数。\r<BR>诗曰：非业破运灾祸重，厄难迭来又惨淡，病弱短命真不幸，一生难得报平安。\r<BR>\r<BR>非业破运的空虚数。（凶）\r<BR>基业：官星、部将、美术、智能、红艳、凶象。\r<BR>家庭：亲情不立，兄弟相隐，离祖败家，凡事百忍则家中能平和。\r<BR>健康：泥牛进海，难以为继。三才配合不善者命运多难，病弱。金木者安全。\r<BR>含义；物将坏之象。具有短命非业的诱导，所谓大凶之运一不生不得平安，灾祸频临，为如意，陷于逆境。或导至病弱，短命，非业，破灭，不能支持一家者。或幼时别亲，而陷困苦或者叹子女的不幸。或者男女丧失其配。', '20');
INSERT INTO `sm_81` VALUES ('21', '（明月中天）光风霁月，万物确立，官运亨通，大搏名利。女性不宜此数。　', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>吉祥运（表示健全、幸福、名誉等）', '明月中天，万物形成确定之势，能为领导，兴家立业。（女性用则不吉，婚姻不顺）\r<BR>诗曰：明月光照乐依依，唉如梅花待放时，男人头领女不宜，各个独立有权威。\r<BR>\r<BR>明月照光，体质刚健之数。（大吉）\r<BR>基业：天官、太极、文昌、哲学，财库，福禄，首领，君臣，富翁。\r<BR>家庭：六亲和睦，有中之嗣惠，若女人不为吉，用则破大运。\r<BR>健康：秋月芙蓉，状年健状、长寿。\r<BR>含义：风光霁月之象，万物形成自立这势。独立权威，能为首领之运。为人尊仰，享受富贵显荣。路径属渐进发展，中途难免相当苦心，步步而进，宛如登梯一样。立业兴家，大博名利，乃贵重的吉数。因系伟大的首领格，妇女得此数者，反招灾害。按《易经》上观点女性属阴，应从男性，是为先天的补数。如具备首领之运，即妻凌夫之格。阴阳生出暗斗，自然不得安宁，故夫妻难免时常反目，或喜极余庆，且妇德为备，家庭园满，则非夫克妻，妻便克夫，所谓两虎相斗，必无双全者慎之！戒之！', '21');
INSERT INTO `sm_81` VALUES ('22', '（秋草逢霜）秋草逢霜，困难疾弱，虽出豪杰，人生波折。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）\r<BR>孤独运（妻凌夫或夫克妻）', '秋草逢霜，徒劳无功，百事不如意，人生多波折。\r<BR>诗曰：秋草逢霜不如意，不平不满却难依，逆境挫折意志薄，身世凋零心过劳。\r<BR>\r<BR>秋草逢霜的斗争数。（凶）\r<BR>基业：远洋、天乙，君臣，将星、劫赌，市财。\r<BR>健康：常有暗疾，三好四怯或医短命。\r<BR>含义；百事不如意，志向半途而废，多属懦弱，正职秋草逢霜之象，困难，病弱无气力，陷孤独，逆境不平常，但也有伟人，豪杰有此数者，不过其人生多波折。', '22');
INSERT INTO `sm_81` VALUES ('23', '（壮丽） 旭日东升，壮丽壮观，权威旺盛，功名荣达。女性不宜此数。', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>吉祥运（表示健全、幸福、名誉等）', '旭日东升的发育旺盛数，伟大的领导运，权力旺盛，感情锐利可爱。（女性用则不吉，婚姻不顺）\r<BR>诗曰：旭日东升势壮当，男属头领女寡向，终至荣达功名显，龙虎添翼声势强。\r<BR>\r<BR>旭日东升发育旺盛数。（大吉）\r<BR>基业：首领、君臣、暗禄、财库、进宅、学士。\r<BR>家庭；男人园地，女人则零落，人格此数多克夫。\r<BR>含义：伟大昌隆之运。威势冲天之象，微贱出身，逐渐长大，终至首领。有如凯旋之将，猛虎添翼之势。权力旺盛，致胜事业，功名荣达，大志大业可成。但平常气血强旺，临事恐过度而为憾。然而感情锐利，壮丽可爱，实属贵重的运数。但女性有此则不及此，其理由同于二十一数，妇女凡主运以及他格有此数者，难免转成零落而绣榻悲寒也。', '23');
INSERT INTO `sm_81` VALUES ('24', '（掘藏得金）家门余庆，金钱丰盈，白手成家，财源广进。　', '大吉', '富贵运（多钱财、富贵、白手可获巨财）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>温和运（性情平和、能得上下信望）', '金钱丰盈数，德智兼备，白手成家，财产愈来愈丰厚，财库。\r<BR>诗曰：家门余庆福无疆，子孙繁荣富贵强，白手成家立大业，财源广进智谋全。\r<BR>\r<BR>家门余庆的金钱丰盈数。（大吉）\r<BR>基业：大官、福星、文昌、企业，财库、君臣，工商、富贵。\r<BR>家庭；不依祖业而立身，家庭圆满，兄弟和睦，但应保持无私。\r<BR>健康：松柏常青，可望长寿。\r<BR>含义：路途多有崎岖，实为难免。然而策略智谋出众，白手可以成家，财源广进到老愈直，子孙继承余庆的福运。', '24');
INSERT INTO `sm_81` VALUES ('25', '（荣俊） 资性英敏，才能奇特，涵养性情，可成大业。　', '大吉', '吉祥运（表示健全、幸福、名誉等）\r<BR>刚情运（性刚固执、意气用事）', '英俊、资性英敏、性格刚毅。有才华、但性情不平衡，偏重一方，言语柔中带硬，应谦虚。\r<BR>诗曰：资性英敏有奇能，柔中带硬真性情，修身涵养与人和，奏功获得大鸿图。\r<BR>\r<BR>英俊，资性英敏的刚毅数。（大吉）\r<BR>基业；君臣、首领、福星、文昌、企业、财禄、技艺、财库、进田。\r<BR>健康：健康自在，三才善良者可望长寿。\r<BR>含义：资性英敏，有奇特的才智，唯性情不平衡而偏重于一方，言语多少有点棱角柔中带硬，性格刚毅，与外人打交道缺谦虚。培养谦虚品性，修身涵养，以其英俊之才，自有望成大业。', '25');
INSERT INTO `sm_81` VALUES ('26', '（变怪） 变怪之谜，英雄豪杰，波澜重叠，而奏大功。　', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）\r<BR>艺能运（富有艺术天才，对审美、艺术、演艺、体育有通达之能）', '英雄运格，一生波涛重叠，变故颇多，富有义气侠情，爱助人为乐，但却好运难随。（女性用则不吉，婚姻不顺）\r<BR>诗曰：变怪异奇多曲折，吉凶极端终无益，变乱艰难缠身凶，家破人亡祸灾强。\r<BR>\r<BR>变怪奇异的豪侠数。（半吉）\r<BR>基业：豪侠、君臣、官禄、侠义，红舞，财库、凶危。\r<BR>家庭：亲情无义妻子无助，若子女温顺可得圆满。\r<BR>健康：属波漾重叠，数奇怪变化的英雄运格。有义气侠情，然而变化常多，风波不息此数中人，临万能，过死线，而奏大功者有之，力不足，随波逐流，碰波折而破产亡家者有之。又因为他格的配合，或陷放逆，淫乱。短命，或者丧配偶，銮褥生霜。或丧子女膝下零丁。属大都不得顺境的数运。但不少怪杰烈士伟人则有出其格者。', '26');
INSERT INTO `sm_81` VALUES ('27', '（增长） 欲望无止，自我强烈，多受毁谤，尚可成功。', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）\r<BR>刚情运（性刚固执、意气用事）', '自我心过强，多受诽谤攻击，诽难运，就算本身温顺而富有，也不免背后内部是非不息。\r<BR>诗曰：迎新去旧无限度，批难中折亦多劳，欲望无止到难与，矫正弱点接待人。\r<BR>\r<BR>欲望天上境，宜静待时数。（半吉）\r<BR>基业：天官，将军，师长，学士，文昌，凶厄，破财，残疾。\r<BR>家庭：六亲不得利，兄弟远离。\r<BR>健康：病，刑罚，心脏病，短命，先天五行为水者可望安全。\r<BR>含义：自我心强，多会诽谤攻击，而易致失败。所谓难运，大多为半路中折之象，始以其智谋，努力奋斗博得名利待过中年，势惭趋大，内外酿出不和，难以发达到老。假使自身温顺富有也不会避开背后是非不息。因此需注意心平气和，宽以待人，严于律己。\r<BR>', '27');
INSERT INTO `sm_81` VALUES ('28', '（阔水浮萍）遭难之数，豪杰气概，四海漂泊，终世浮躁。女性不宜此数。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）\r<BR>孤独运（妻凌夫或夫克妻）\r<BR>刚情运（性刚固执、意气用事）', '遭难运，有义气侠情，但人格有此数者，凡文人、学者在事业上难得建树。（女性用则不吉，婚姻不顺）\r<BR>诗曰：自豪生离终身苦，遭难不安何可渡，夫妻相克家落薄，结成冤仇造敌城。\r<BR>\r<BR>豪气生离的行踪无定数。（凶）\r<BR>基业：天官，将星，官性，学士，红艳。\r<BR>家庭：亲属多忌怨，兄弟少联络，子女别离。\r<BR>健康：三才不良者病灾，残疾，发狂，三才善良者无大害。\r<BR>含义：堪称遭难运，有一种英雄气概，多于波澜起伏，但难逃非难诽谤，时或厄难袭来，而致伤，或丧失配偶，相克子孙，也可能有自幼别亲者，总之大都有祸乱，争论不和、逆难、刑罚等，灾祸相接，终生劳苦。妇女有此数者多陷于为孤寡独身、难成家或家庭不幸的运格。', '28');
INSERT INTO `sm_81` VALUES ('29', '（智谋） 智谋优秀，财力归集，名闻海内，成就大业。　', '半吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>富贵运（多钱财、富贵、白手可获巨财）\r<BR>次吉祥运（表示多少有些障碍，但能获得吉运）\r<BR>艺能运（富有艺术天才，对审美、艺术、演艺、体育有通达之能）', '有财力，有活动能力，但是不平不足的念头不断，欲望无止境，多失败。（女性用则不吉，婚姻不顺）\r<BR>诗曰：欲望难足希望大，计谋成功财力来，猜疑妒忌性自改，如龙乘云时运开。\r<BR>\r<BR>泉舟顺展的大立功数。（半吉）\r<BR>基业：天官，太极，君臣，天厨，将星，财帛，文昌，深谋，富翁。\r<BR>家庭;乏祖力，地格为时，有乏子息或不和。\r<BR>健康：先天五行为金而三才善良者，可望安康，土火者弱病之虑。\r<BR>含义：智谋优异，奏功受福之格，财力活动力俱备，成就大业之相，但是不足不平的念头不绝，任意行事，欲望无止境多易弄巧成拙，至于妇女，都流于男性，或者造成荒唐猜疑之灾，切要慎戒之。', '29');
INSERT INTO `sm_81` VALUES ('30', '（非运） 沉浮不定，凶吉难变，若明若暗，大成大败。　', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）', '沉浮不定，吉凶难分，其运就开矿探险一般。\r<BR>诗曰：绝死逢生多危险，投机浮沈受灾殃，处事细虑保安然，若无终生孤独人。\r<BR>\r<BR>绝境逢生的运路分岐数。（凶）\r<BR>基业：官星，将星，文昌，豪放，红艳，血支，实厄。\r<BR>家庭：亲情不亲，夫妻不相合难同白头。\r<BR>健康：刑罚，外伤，残疾，先天五行为金者可安然。\r<BR>含义：浮沉不定，凶吉难分。即因其他运的配合，或者成功，或者陷于失败，故有吉运者，成功自至，数理不良者不知不觉之间陷于失败。其不可测，就象开矿探险一样，大成大败，具有侥幸。另外此数也可能有孤独，丧失妻子，短命者。基', '30');
INSERT INTO `sm_81` VALUES ('31', '（春日花开）智勇得志，博得名利，统领众人，繁荣富贵。', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>温和运（性情平和、能得上下信望）', '此数大吉，富贵繁荣的领导运，女性用亦无妨。\r<BR>诗曰：智勇得志意气新，建立声誉事业成，富贵幸福将有到，为人领导德望高。\r<BR>\r<BR>智勇德智，可享清福。（大吉）\r<BR>基业：太极，君臣，将星，学士，文星，田宅，祖业。\r<BR>家庭：可望幸福，子女多萌，地格被克者刚不过。\r<BR>含义：智仁勇俱备，意志坚固，千挫不挠，脚步踏实，能成就大业的运格，可率众人，博得名誉，繁荣富贵幸福，属温柔平静，运势强大的首领运。', '31');
INSERT INTO `sm_81` VALUES ('32', '（宝马金鞍）侥幸多望，贵人得助，财帛如裕，繁荣至上。', '大吉', '富贵运（多钱财、富贵、白手可获巨财）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>男性双妻运\r<BR>温和运（性情平和、能得上下信望）', '性格温顺，得意外之福德。\r<BR>诗曰：侥幸所得贵人扶，善捉机会有财富，认真努力向前程，家门隆昌得富荣。\r<BR>\r<BR>侥幸多能的意外惠泽运。（大吉）\r<BR>基业：天德，月德，君臣，将星，文星，学士，文昌，进宅，祖业。\r<BR>家庭：家门隆星，可能园满，子孙旺发，男有双妻之格。\r<BR>健康：可能圆满，而三才者有略患。\r<BR>含义：饶幸多望之格，若能长辈提携，其成功势如破，世品性良，大有爱护他人之德，家门隆昌，繁荣，至上吉数。', '32');
INSERT INTO `sm_81` VALUES ('33', '（旭日升天）旭日升天，鸾凤相会，名闻天下，隆昌至极。女性不宜此数。', '大吉', '富贵运（多钱财、富贵、白手可获巨财）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>艺能运（富有艺术天才，对审美、艺术、演艺、体育有通达之能）', '功威智谋，名闻天下，常人恐不堪当。（女性用则不吉，婚姻不顺）\r<BR>诗曰：家门隆昌精神爽，协得名利星月朗，女乃孤寡不堪当，男是天下富豪翁。\r<BR>\r<BR>家门昌隆，才德开展数。（大吉）\r<BR>基业：天官，臣将，部长，文昌，学士，田宅，富翁。\r<BR>家庭：可望幸福，身强口硬，妇女用则孤寡。\r<BR>健康：可望健康，三才不善或不合先天五行者，病患亦有之。\r<BR>含义：鸾风相会之象，形成确定之意。多功威智谋，刚毅果断有如旭日东升，旺极昌隆至极，属名闻天下的吉祥数。但如果过刚毅，反致误事，而且过贵重，常人恐不堪受。又物极必反，繁荣的反面为黑暗，勿轻用之，妇女断不可用，用则孤寡。', '33');
INSERT INTO `sm_81` VALUES ('34', '（破家） 破家之身，见识短小，辛苦遭逢，灾祸至极。', '大凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）\r<BR>孤独运（妻凌夫或夫克妻）', '此数大凶，破家亡身，绝不可用。\r<BR>诗曰：破家亡身死无丧，艰难不绝多波浪，大凶一到黄泉客，何谓用此名定凶。\r<BR>\r<BR>破家亡身的见识浅少数。（凶）\r<BR>基业：臣将，君臣，文昌，学士，破财，凶厄，破灭。\r<BR>家庭：家缘薄，妻子分离，忍耐可保症安。\r<BR>健康：短命，杀伤，刑罚，脑溢血，麻疹，发狂，先天五行三才善才者也可以得安康。\r<BR>含义：属破坏的大凶运。乱离的祸象颇强，凶煞一到，便接连而来，事业生大凶大困难，大辛苦，内外破乱，万事龊龌，衰败，悲痛无限，因其他数的配关系，有病弱短命，丧失配偶，子女离别，刑伤，杀伤，或致发狂灾祸至极，为破家，亡身的最大凶数。', '34');
INSERT INTO `sm_81` VALUES ('35', '（高楼望月）温和平静，智达通畅，文昌技艺，奏功洋洋。　', '大吉', '吉祥运（表示健全、幸福、名誉等）\r<BR>艺能运（富有艺术天才，对审美、艺术、演艺、体育有通达之能）\r<BR>温和运（性情平和、能得上下信望）', '高楼望月，优雅发展，此数最合女性，或那些性格过强之人。\r<BR>诗曰：温和平安好艺才，努力前程福将来，此数最合女人态，一般多是守财人。\r<BR>\r<BR>温和平静的优美发展数。（大吉）\r<BR>基业：将相，学士，文昌，艺术，财库，田宅，工商，温柔。\r<BR>家庭：上流家庭，可能园满，被运格克者，病苦亦有之。\r<BR>含义：温良和顺之象，有智达的能力，在文艺技术方面定能发展而奏功洋洋，若怀大志，欲为大事者，宜大振力气，彻底节义，以补不彻底的赋性和权威号召力，因其缺少谋略气魄，故此数实为保守平安的吉祥数，所以此最适合女性，为男性则倾向消极。', '35');
INSERT INTO `sm_81` VALUES ('36', '（波澜重叠）波澜重叠，沉浮万状，侠肝义胆，舍己成仁。　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '风波不息，枉费心力，&nbsp;为义气侠情舍己成人，一生难得平安，辛苦困难。\r<BR>诗曰：风浪不静难得安，侠情波浪万事难，务养精神小微利，为人挑难做风头。\r<BR>\r<BR>风浪不平静的枉费力数。（凶）\r<BR>基业：将星，学士，文昌，文相，破厄，凶煞，崩山，劫家。\r<BR>家庭：六亲不力，夫妻离合，子息宜迟，应多做善事，以含积德。\r<BR>健康：短命，病患，外伤，病疾，三才善良者，可望安康。\r<BR>含义：为波澜重叠，浮沉万状的英雄运，为侠气义睛敦厚，杀身成人之格，一生难得平安，辛苦困维多，袖手不进失几沦落。与其它运配蛤不善者，或病弱，短命，危难等不无所至。', '36');
INSERT INTO `sm_81` VALUES ('37', '（猛虎出林）权威显达，热诚忠信，宜着雅量，终身荣富。', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>刚情运（性刚固执、意气用事）', '权威显达，发展基业数，但其人应多注意平和，否则有孤独之感。\r<BR>诗曰：权威显达得众望，忠实热诚运集旺，大德奏功无难事，终得富荣乐康旺。\r<BR>\r<BR>权利显达，发展基业数。（大吉）\r<BR>基业：将星，官禄，文昌，艺术，权利，祖业。\r<BR>家庭：家庭和睦圆满，女性若有烈强，官守女德，则有可望。\r<BR>健康：长寿多，先天五行或人格克者，易患疾病，少数为心脏病。\r<BR>含义：独立，权威，忠实，奏功无比之象，主畅通达，热诚忠烈，得众信，破万难而成大业，慈祥有德，善发挥才能，享受天福之幸，终身富贵至极，但因权威独行，而难免有独立感，宜心存平和，留神静安。&nbsp;\r<BR>', '37');
INSERT INTO `sm_81` VALUES ('38', '（磨铁成针）意志薄弱，刻意经营，才识不凡，技艺有成。', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）\r<BR>艺能运（富有艺术天才，对审美、艺术、演艺、体育有通达之能）', '意志薄弱、实在缺乏领导的才干，但是向文学技术方面发展则有较强的上进心。\r<BR>诗曰：意志薄弱无威望，长于技艺得长风，始终努力向上去，将见收得光明路。\r<BR>\r<BR>意志薄弱的刻决经数。（半吉）\r<BR>基业：将星，学基，臣将，神童，技艺，凶煞，伤杀。\r<BR>家庭：亲属冷淡，兄弟无助，宜平和可满。\r<BR>健康：灾维，外伤，肮病，三才配合者尚可园满，\r<BR>含义：非于大成，实乏统率的人心，缺乏首领的才干，属于有志而乏力，不得众信，一种薄弱平凡之象，自然易险于不幸失意而难以成功，但象文学技术方面发展，则有较强的能力故此数为艺术成功数。', '38');
INSERT INTO `sm_81` VALUES ('39', '（富贵荣华）富贵荣华，财帛丰盈，暗藏险象，德泽四方。　', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>男性双妻运', '富贵繁荣却变化无穷数，常人不堪当。（女性用则不吉，婚姻不顺）\r<BR>诗曰：富贵荣华实可当，光明荣达好儿郎，女人有此定孤寡，藏有悲惨逢凶险。\r<BR>\r<BR>富贵荣华的变化无穷数。（大吉）\r<BR>基业：臣将，文昌，艺术，智能，财库，进田。\r<BR>家庭：安宁自在，可望园满，子孙昌盛，三才被克者则不园满。\r<BR>健康：可望安康，三才不善者有病弱。\r<BR>含义;此数为祸乱一过，反成幸福贵重之格，权利，长寿，财帛丰富，德泽四乡，财富盈身，富贵已极，暗埋悲惨之象，所谓物极必反，切勿轻用之。妇女若有此数者必陷孤寡。', '39');
INSERT INTO `sm_81` VALUES ('40', '（退安） 智谋胆力，冒险投机，沉浮不定，退保平安。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '富智能威力，但含不逊之心，缺乏威望，宜平和保守。\r<BR>诗曰：谨慎保安勿自骄，智谋胆略又显晓，批难变转冒险处，刑场遭难孤独悲。\r<BR>\r<BR>谨慎治安的豪胆迈进数。（凶）\r<BR>基业：将星，文昌，学士，豪杰，胆量，凶灾，祸厄，劫财\r<BR>家庭：亲情远淡，兄弟分离。\r<BR>健康;凶病，胃病外伤，三才善良者可弥补。\r<BR>含义：富智谋，有心机，然含不逊之心，乏声望，易受诽谤功击，外于浮沉协凶的歧路上，好危险投资，依其他运关系，有酿刑伤罪。犯病者有陷病弱，独短命者，有爱动反招失败，故为进而招祸。', '40');
INSERT INTO `sm_81` VALUES ('41', '（有德） 纯阳独秀，德高望重，和顺畅达，博得名利。此数为最大好运数。　', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>富贵运（多钱财、富贵、白手可获巨财）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>男性双妻运', '德高望重，事事如意数，能成大业的最大好运。\r<BR>诗曰：德望高大名誉振，智谋健全财源进，富贵荣华福碌至，前途洋洋得意真。\r<BR>\r<BR>德高望重的事事如意数。（大吉）\r<BR>基业：将星太极，名人，老者，学士，学者，官禄，财库，福星。\r<BR>家庭：家庭圆满，子孙昌盛，地格被克者不遇。\r<BR>健康：可望健康长寿，二才不善者不遇。\r<BR>含义;纯明独秀的吉数，胆力才谋具备，健全，有德，能成大业，顺利的最大好运数。(by senlon)', '41');
INSERT INTO `sm_81` VALUES ('42', '（寒蝉在柳）博识多能，精通世情，如能专心，尚可成功。　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '十艺不成的穷困已极数，博识多能、精通世情，无奈十艺九不成，要专心进取。\r<BR>诗曰：十艺不成学艺真，博达艺能结果因，意志薄弱不取心，将于陷落孤独人。\r<BR>\r<BR>十艺不成的穷困已极数。（凶）\r<BR>基业：君臣，部将，官星，文昌，劫煞，灾厄，凶变。\r<BR>家庭：亲情无义，朋友无缘，妻子反目，三才善者则无妨。\r<BR>健康：病弱，先天五行为火，者可望安康，但须三才善良。\r<BR>含义：博识多能，有技艺，精通世情，无奈十艺九不成，多薄弱不如意，缺乏自信心为寂寞悲苦之象，失意之状，如果专心进取，或者可以成功，不然必大失败，此数中也有孤独病弱者。', '42');
INSERT INTO `sm_81` VALUES ('43', '（散财破产）散财破产，诸事不遂，虽有智谋，财来财去。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '须防邪途灾害加重，散财破产运，毅力不确定，薄弱之象，外观幸福，内多困苦。\r<BR>诗曰：雨夜之花是薄命，虚做假实总无影，失去信用无地行，终老无依入黄泉。\r<BR>\r<BR>须防邪途灾祸重数。（凶）\r<BR>基业：将星，文字之星，学者，凶星。灾厄伤残。\r<BR>家庭：妻弱无助，子多不肖，心心相印，三才善良者无妨。\r<BR>健康：病弱，外伤，短命，三才善良才可平安。\r<BR>含义：散财破产运，因循姑切，犹如夜雨之花，薄弱散滹之象，虽有才能知识，意力不确定，诸事不能随行，外观幸福，内多困苦，表面依然成事，里面不堪设想，如果妇女有此数，加上其他关系，必逐荒凉。', '43');
INSERT INTO `sm_81` VALUES ('44', '（烦闷） 破家亡身，暗藏惨淡，事不如意，乱世怪杰。　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '愁眉难展破家财，暗淡辛苦悲运来，遭难逆境无所止，配合不宜有横死。难用心计，事难遂愿，贪功好进，必招失败。须眉难展，力量有限数，最大凶运的暗示。一生多遇困难?若注重亲人关系?适时积财?也可谓平安。（平），清家荡产之最凶之数也，藏有家财破败，人口离异，暗淡惨苦之悲运，诅事不能如意，多障碍，逆境，病患等，如他运配合关系有致发狂横死等之不幸，于壮年或中年时如有一时的幸运，然而至于中年末就倾泻一尽，故斯时应谨慎节俭以济晚年之凄凉，但有不出世之怪杰，伟人，烈士，孝子，节妇等诅此数。，「愁眉难展」\r<BR>', '44');
INSERT INTO `sm_81` VALUES ('45', '（顺风） 新生泰和，顺风扬帆，智谋经纬，富贵繁荣。', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>吉祥运（表示健全、幸福、名誉等）', '新生泰和的万事如意数，富贵繁荣至极，如五格配合不当则可能转为凶运。\r<BR>诗曰：新生泰运顺行舟，排除万难总无忧，成功繁荣四海明，荣华富贵好前程。\r<BR>\r<BR>新生泰和万事如意数。（大吉）\r<BR>基业：部将，君臣，文昌，学士，艺术。\r<BR>健康：可望圆满，子孙昌盛，三才不善者不寓，安康长寿，人格被克者不才。\r<BR>含义：顺风扬帆之象，经纬深，智谋大，可遂大志大业，克破万难而成功，富贵繁荣至极，但若与运的凶数结合，即如浪里失舵船，易遭灾难。', '45');
INSERT INTO `sm_81` VALUES ('46', '（浪里淘金）载宝沉舟，浪里淘金，大难尝尽，大功有成。　　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '载宝沉舟之象，有大成功者，也有大失败者。\r<BR>诗曰：罗网击身运大凶，一生困苦受灾难，身病孤贫无可靠，难得平安船逆风。\r<BR>\r<BR>须防复失的离祖破家数。（凶）\r<BR>基业：臣将，将星，学士，豪杰，文昌，凶厄，崩山。\r<BR>家庭;亲多往且子孙宜迟，三才善者可弥补。\r<BR>健康：刑罚，病弱，短命，外伤，暗伤，三才善者可望健。\r<BR>含义：载宝沉舟之象，乏力，薄弱，悲衰困难辛苦，破坏失败者多，然而属一类变怪的命运，有大艰难尝尽后而又成功者，或依其他命运的关系，致陷孤独刑罚，病患短命等灾祸，总之是难免于不幸的命运。', '46');
INSERT INTO `sm_81` VALUES ('47', '（点石成金）花开之象，万事如意，祯祥吉庆，天赋幸福。', '大吉', '首领运（智慧仁勇、立上位、能领导众人）\r<BR>吉祥运（表示健全、幸福、名誉等）\r<BR>刚情运（性刚固执、意气用事）', '开花结果，权威进取数。可得天赋的幸福，可进可退，退可以守的大吉运。\r<BR>诗曰：开花结子衣食在，荣华富贵福招来，子孙繁荣多快乐，一家圆满庆有余。\r<BR>\r<BR>开花结果的权威进取数。（大吉）\r<BR>基业：君臣，将星，文昌，学士，艺术，高傲，食禄，财库。\r<BR>家庭：家庭圆满，然时有争执，三才不善者和睦相处。\r<BR>健康：可望长寿，健康，三才不善者，也有病弱，短命的可能。\r<BR>含义：开花之象，祯祥吉庆之数，可享天赋的幸福，与朋友合作以成大事大业，真是进可以攻，退可以守福，可遗禄于子孙的吉运。', '47');
INSERT INTO `sm_81` VALUES ('48', '（古松立鹤）智谋兼备，德量荣达，威望成师，洋洋大观。　', '大吉', '吉祥运（表示健全、幸福、名誉等）\r<BR>艺能运（富有艺术天才，对审美、艺术、演艺、体育有通达之能）', '德智兼备最宜为人之师，或他人的顾问。\r<BR>诗曰：有德且智德望高，堪为顾问得人和，名誉利达天赋高，威望荣达世间夸。\r<BR>\r<BR>德智兼备的出身清贵数。（大吉）\r<BR>基业：将相，官禄，文昌，学士，文艺，财库。\r<BR>家庭：家庭圆满，子孙满堂，三才不善者不寓。\r<BR>健康：良好，可望长寿，三才不善者不寓。\r<BR>含义：才望谋略齐备，内含坚刚，为功利荣达的吉数，宜为人的顾问，威望洋洋，乃师数也。', '48');
INSERT INTO `sm_81` VALUES ('49', '（转变） 吉临则吉，凶来则凶，转凶为吉，配好三才。　', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）', '吉凶难分，不断辛苦。\r<BR>诗曰：吉凶难分运歧路，三才配置好鸿图，若是逢凶灾害至，终老变成苦安居。\r<BR>\r<BR>吉凶难分的不断辛苦数。（半吉）\r<BR>基业：臣相，将星;文昌，智谋，学士，凶象，散财。\r<BR>健康：凶灾，病灾外伤，短命，三才不善者可补救，\r<BR>家庭：六亲得力，子自宜退。\r<BR>含义：处吉凶的岐路，吉临则吉又生大吉，凶来则凶又变大凶，所以成败不得失极其浩大，有处大凶而其他方面化吉者，其幸福与不幸，专靠三才配合的好坏，以及其他运的联系显现，多陷落于灾祸。', '49');
INSERT INTO `sm_81` VALUES ('50', '（小舟入海）一成一败，吉凶参半，先得庇荫，后遭凄惨。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '吉凶参半，须防倾覆。\r<BR>诗曰：一成一败一瞬间，浮沈未定难得安，与时不知宜戒心，败衰始觉已运迟。\r<BR>\r<BR>吉凶参半，需防倾覆数。（半吉半凶）\r<BR>基业：将官，文昌，财钱，灾祸，离愁，散财。\r<BR>家庭：亲属多而无助。\r<BR>健康：刑罚，杀伤，意外之灾，外伤，白痴，狂癫等疾。\r<BR>含义：成败之象，先得五字的数理庇荫，而成大业，享按富贵，后由盈数（凡十谓之盈数）的暗示诱导而成陷失败，亡身破于晚年，凄惨至极，若其他运又凶数者，则是惨上加惨。杀伤，离秋，孤单频临，或至于刑罚。', '50');
INSERT INTO `sm_81` VALUES ('51', '（沉浮） 盛衰交加，波澜重叠，如能慎始，必获成功。　', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）', '一盛一衰，竭力经营。\r<BR>诗曰：成衰交加命运期，一时名利就分歧，平生保守平安路，到老变成苦安居。\r<BR>\r<BR>盛衰交加的竭力经营数。（半吉）\r<BR>基业：文昌，学士，节度，时禄，劫煞，败退\r<BR>家庭：时有争执，灾祸病患，三才善者安康自在\r<BR>含义：一盛一衰之象，必然可得昌盛，搏得一时名利，然后发现运中自然的凶兆，到晚年出挫折困苦。遂至失败。', '51');
INSERT INTO `sm_81` VALUES ('52', '（达眼） 卓识达眼，先见之明，智谋超群，名利双收。　', '大吉', '富贵运（多钱财、富贵、白手可获巨财）\r<BR>吉祥运（表示健全、幸福、名誉等）', '有先见之明，理想实现数，无中生有名利双收大吉数。\r<BR>诗曰：先见机明会佳期，意志坚固庆有余，功名利达福双全，一世荣华乐千锺。\r<BR>\r<BR>先见之明，理想实现数。（大吉）\r<BR>基业：元帅，医师，文昌，技艺，财库，官禄，财星\r<BR>家庭：幸福，顺从行孝，子女和睦，三才不善者不遇。\r<BR>健康：可望健康，长寿，人格被克者不遇，\r<BR>含义：属于运将申之象，势能强大，无中生有的运数，有先见之明，计划必成，眼能察时世，富投机心，有谋略，他人之难不为难，实现大志大业而名利双收，因为有眼光而成功。', '52');
INSERT INTO `sm_81` VALUES ('53', '（曲卷难星）外祥内患，外祸内安，先富后贫，先贫后富。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '外观幸福，内多障碍，如前半生幸福就是后半生不幸，如前半生不幸就是后半生幸福，大多凶运。\r<BR>诗曰：心内忧愁无人知，外盛内衰迫近期，晚年多灾荡家尽，若得幸运护好持。\r<BR>\r<BR>忧仇困苦，内心忧愁数。（凶）\r<BR>基业：伟人，学示，时禄，磨难，灾祸，劫煞\r<BR>家庭：亲眷寡情，乏子息\r<BR>健康：病灾，祸患，外伤，刑罚，三才善者或可谜补\r<BR>含义：外观依然吉庆臻辉，内实祸患甚多，若非前半生不幸而后半生幸福，便是前半生富贵而后半生落魄，及盛衰参半的运数，一旦陷入凶煞，大多破家身亡，即使的吉数他运相救，亦仅得小安而已。', '53');
INSERT INTO `sm_81` VALUES ('54', '（石上栽花）石上栽花，难得有活，忧闷烦来，辛惨不绝。　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '多难悲运，难望成功，大凶运的暗示。\r<BR>诗曰：多难非运多障害，忧苦不和祸又来，横死刑场终惨绝，饿死定数是大凶。\r<BR>\r<BR>多难悲运的难望成功数。（凶）\r<BR>基业：文昌，技艺，凶灾，劫煞，时禄，灾祸\r<BR>家庭：父母入过客，兄弟似残星，和睦相处，亦可无大过，\r<BR>健康与含义：为大凶煞按示，悲惨不绝，不和损伤，忧闷频来，遂至倾家荡财，或患废疾，刑罚，短命横死孤独等。', '54');
INSERT INTO `sm_81` VALUES ('55', '（善恶） 善善得恶，恶恶得善，吉到极限，反生凶险。　', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）', '外美内苦，和顺不实数。\r<BR>诗曰：外美内苦暗伤悲，一面极盛一面衰，吉凶参半难以定，克服难关会佳期。\r<BR>\r<BR>外美内恶的和顺不实数。（半吉）\r<BR>基业：非官，技艺，文昌，学者，灾祸\r<BR>家庭：亲眷忌，父母老病，尽心忠孝可天大过\r<BR>健康：三才善者可健全，余则不过安康。\r<BR>含义：五数为最吉数，五上添五乃是最吉重叠，反而生凶相了，故表面颇为隆盛，而内里则是灾祸叠生，凡事不能安心，危难别离，病难等无所不至因而是吉凶相办的运格，志弱者绝无立身之地，善能震雄威，坚心为业志，打破万难也可能有成功之日。', '55');
INSERT INTO `sm_81` VALUES ('56', '（浪里行舟）历尽艰辛，四周障碍，万事龃龌，做事难成。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '缺乏实行的勇气，万事难行，最凶的运格。\r<BR>诗曰：暮日凄凉事难成，进取心薄不安然，万事龌龊精力败，晚运惨至破家财。\r<BR>\r<BR>初历尽困苦，四周障碍数。（凶）\r<BR>基业：豪杰，文昌，时禄，文艺，红艳，灾祸，伤身\r<BR>家庭：不可靠亲的福，残嘣。\r<BR>健康：外伤，病难，维残，短命，三才善者可望安全。\r<BR>含义：缺乏实行的勇气，缺乏进取的精神，损失，灾祸等，是祸不单行者。万事龆龃啮龃，财力不足，乃是最大的运格。\r<BR>', '56');
INSERT INTO `sm_81` VALUES ('57', '（日照春松）寒雪青松，夜莺吟春，必遭一过，繁荣白事。', '大吉', '吉祥运（表示健全、幸福、名誉等）', '寒雪春松的最大荣运数，资性刚毅，黑夜过后便是天明。\r<BR>诗曰：寒雪青松性刚强，一生一度遇灾殃，然后发达利亨通，终生繁荣福无疆。\r<BR>\r<BR>寒雪青松的最大运数。（大吉）\r<BR>基业：官禄，文昌，学士，艺能，时禄，财库，进田。\r<BR>家庭：文田不严，时有冲突，三才善者，可得圆满。\r<BR>健康：自在，可望长寿，三才不善者不在此数。\r<BR>含义：寒岭春格，资格刚毅，获天赋之幸福而招致富贵，但这一生必遭大难一次，然后得享吉祥，繁荣，百事可以如意。', '57');
INSERT INTO `sm_81` VALUES ('58', '（晚行遇月）沉浮多端，先苦后甜，宽宏扬名，富贵繁荣。', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）', '先苦后甜，大都晚年幸福。\r<BR>诗曰：先苦后甘有苦思，难关度过福人扶，晚年幸福兼余庆，合如甘蔗好尾甘。\r<BR>\r<BR>先苦后甜，气宏扬堍数。（半吉）\r<BR>基业：官禄，文昌，学士，技艺，灾厄，伤残。\r<BR>家庭：亲情少，兄弟离，须互相信任。\r<BR>健康：伤残，刑罚，外伤，三才善者可望平安。\r<BR>含义：浮沉多端，祸福无常，所得福分，必经大失败大患难后方能显著，家破产亡后方得富贵荣华，大都蔗根生甜。晚年享受安庆。', '58');
INSERT INTO `sm_81` VALUES ('59', '（寒蝉悲风）寒蝉悲风，意志衰退，缺乏忍耐，苦难不休。　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '无办事能力，愁苦一生。\r<BR>诗曰：车轮无毅不能行，失意逆境却难定，一旦过灾终不起，终为非命注凶程。\r<BR>\r<BR>须防外患的时运不济数。（凶）\r<BR>基业：官星，福星，文昌，智能，灾厄，伤残，财库，破厄。\r<BR>家庭;亲情无缘，子女背景离乡。\r<BR>健康：病患，短命，三才善者可望平安。\r<BR>含义：乏耐心缺勇气，意志衰退，无办事的才能，终于悲苦一生。', '59');
INSERT INTO `sm_81` VALUES ('60', '（无谋） 无谋之人，漂泊不定，晦暝暗黑，动摇不安。　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '无谋不算岂能成功。一生无成。\r<BR>诗曰：黑暗无光不安定，苦惨刑伤事难成，病弱短命多困苦，徒加烦劳损精神。\r<BR>\r<BR>争名夺利，黑暗无光数。（凶）\r<BR>基业：官星，将星，文昌，智能，技艺灾厄，伤残。\r<BR>家庭：祖宗无基，亲友无情，兄弟无缘，三才善者可弥补。\r<BR>健康：外伤，病疫，短命等。\r<BR>含义：属晦冥黑暗，摇动不安的凶象，方向不喧尽任风波的运格，无谋不算而计划岂能成功，故难免失败苦恼或刑罚，杀伤，伤疾患，短命等。', '60');
INSERT INTO `sm_81` VALUES ('61', '（牡丹芙蓉）牡丹芙蓉，花开富贵，名利双收，定享天赋。　', '大吉', '吉祥运（表示健全、幸福、名誉等）', '名利双收，繁荣昌盛。无奈傲慢不逊，易酿成内外不和家庭反目，可能是常说的为富不仁。宜平和。\r<BR>诗曰：名利双收富贵荣，修身养德防未然，傲慢不逊失人和，恐有家庭起风波。\r<BR>\r<BR>名利双收的修行积德数。（大吉）\r<BR>基业：将星，文昌，贩运艺，财库，财帛，破厄。\r<BR>家庭：自立成家，衣食富足。\r<BR>健康：可望长寿，安康，三才不良者无此数。\r<BR>含义：名利双收，繁荣富贵的吉数，无奈骄漫不逊，致酿成内外不和，家庭反目，兄弟离于墙，表面装表堂皇，里面空虚，如果能修德慎行，切守和顺，自可防于末然，享天赋的幸福，一生受尽祯祥。', '61');
INSERT INTO `sm_81` VALUES ('62', '（衰败） 衰败之象，内外不和，志望难达，灾祸频来。　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '基础虚弱，渐入衰败。\r<BR>诗曰：基础虚弱重信用，不和衰败招灾殃，生涯不安因素起，步步留意保平安。\r<BR>\r<BR>基根虚弱的艰困厄数。（凶）\r<BR>基业：国印，文昌，虚度，将星，技艺，灾厄，三才善者可安全。\r<BR>家庭：分贵，骨肉分离。\r<BR>健康：伤残，外伤，刑罚，短命，灾厄，三才善者可安全。\r<BR>含义：内外不和，缺乏信用，志望难达，渐进衰败之境，意外灾祝频来，属身弱步步惨的数。', '62');
INSERT INTO `sm_81` VALUES ('63', '（舟归平海）富贵荣华，身心安泰，雨露惠泽，万事亨通。', '大吉', '吉祥运（表示健全、幸福、名誉等）', '富贵荣华，万事如意，最大吉数。\r<BR>诗曰：富贵荣华得显宁，子孙繁茂福绵绵，一身平安兼益寿，福禄双全享千种。\r<BR>\r<BR>富贵荣华的身心安数。（大吉）\r<BR>基业：官禄，将星，文星，艺能，财库，田宅，商工。\r<BR>家庭：子女多，顺川散敬爱，圆满之象。\r<BR>含义：万物承惠露而发育状大之状，属不费心神，万事如意，荣显可传子孙的最大吉数。', '63');
INSERT INTO `sm_81` VALUES ('64', '（非命） 骨肉分离，孤独悲愁，难得心安，做事不成。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '骨肉分离，一生多忧。\r<BR>诗曰：骨肉分离难平安，浮沈破坏病又难，非业因苦无可靠，生涯孤独多悲哀。\r<BR>\r<BR>骨肉分离，孤独悲恨数。（凶）\r<BR>基业：将星，学士，技艺，厄，破财，劫煞。\r<BR>家庭：一称多忧，妻子欠破。\r<BR>健康：水厄，利罚，病患，外伤，三才善者可平安。\r<BR>含义：此数为破坏，灭懑，沉滞的凶象，有意外灾祸袭来，或骨肉离散，或病患非命临身，人生逡得安心。', '64');
INSERT INTO `sm_81` VALUES ('65', '（巨流归海）天长地久，家运隆昌，福寿绵长，事事成就。', '大吉', '吉祥运（表示健全、幸福、名誉等）', '富贵四方，天长地久，一生平安。\r<BR>诗曰：富贵长寿逢吉祥，家运隆昌喜气扬，福禄繁荣兼富贵，万事皆通可安宁。\r<BR>\r<BR>富贵长亲的富贵四方数。（大吉）\r<BR>基业：臣君，将星，官禄，文昌，技艺，财库，田宅，时禄。\r<BR>家庭：祖业有根基，子孙昌杰，三才不善才无此数。\r<BR>健康：多施恩德则能益寿延年，安康自在。\r<BR>含义：天长地久，家庭隆昌，福寿棉长，事事成就，一生平安，多贵重的气运。(by senlon)', '65');
INSERT INTO `sm_81` VALUES ('66', '（岩头步马）进退维谷，艰难不堪，等待时机，一跃而起。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '进退失自由，内外不和。\r<BR>诗曰：内外不和不自由，进退两难总是忧，难若亦灭艰难到，灾厄交加悲惨运。\r<BR>\r<BR>风外不和的多祸失福数。（凶）\r<BR>基业：将星，豪杰，灾厄，崩山，散财，破财。\r<BR>家庭：六亲冷淡不相投，兄弟远离。\r<BR>健康：刑罚，外伤，亡身，残伤，短命。\r<BR>含义：进退失自由，内外不和，艰难不堪，损伤灾祸交至。大有家破灭亡的凶相。', '66');
INSERT INTO `sm_81` VALUES ('67', '（顺风通达）天赋幸运，四通八达，家道繁昌，富贵东来。', '大吉', '吉祥运（表示健全、幸福、名誉等）', '利路亨通的坚强数,万事无障碍达目的，家道昌盛好运数。\r<BR>诗曰：利路亨通万事成，和畅通达四海明，家运隆盛招富贵，万商云集得繁荣。\r<BR>\r<BR>利路享通的坚强数。（大吉）\r<BR>基业：君臣，将星，文昌，硕士，刚性，艺能，财库，进田。\r<BR>家庭：父母多荫，子女多考，圆满幸福。三才不善者时有争执，宜守和平。\r<BR>健康：安全，可望长寿，先天五行为大业。三才不善者有时患呼吸器官疾病。\r<BR>含义：受长辈上级的援助，万事无障而达到目地，是天助的幸运，实现南望。家道繁昌，富贵好运数。', '67');
INSERT INTO `sm_81` VALUES ('68', '（非业） 非业非力，精神迫滞，灾害交至，遍偿痛苦。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '坐立不安，处世多难。\r<BR>诗曰：坐立不安如萍动，病灾非业逢波浪，发疾短命祸根生，精神失意发狂异。\r<BR>\r<BR>坐立不安处世多难数。（凶）\r<BR>基业：将星，财帛，学士，文昌，技能，艺术，破厄，劫财。\r<BR>家庭：六亲不相投，兄弟难相处，不宜心直口快。\r<BR>健康：刑罚，外伤，病灾，伤残，天生五行为金者可望平安。\r<BR>含义：穷迫，滞塞，逆境之数，缺乏坚定信念，灾祸交至，摇动为安，致陷于短命，病疾或尝尽痛苦而死。', '68');
INSERT INTO `sm_81` VALUES ('69', '（非业） 非业非力，精神迫滞，灾害交至，遍偿痛苦。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '坐立不安，处世多难。\r<BR>诗曰：坐立不安如萍动，病灾非业逢波浪，发疾短命祸根生，精神失意发狂异。\r<BR>\r<BR>坐立不安处世多难数。（凶）\r<BR>基业：将星，财帛，学士，文昌，技能，艺术，破厄，劫财。\r<BR>家庭：六亲不相投，兄弟难相处，不宜心直口快。\r<BR>健康：刑罚，外伤，病灾，伤残，天生五行为金者可望平安。\r<BR>含义：穷迫，滞塞，逆境之数，缺乏坚定信念，灾祸交至，摇动为安，致陷于短命，病疾或尝尽痛苦而死。', '69');
INSERT INTO `sm_81` VALUES ('70', '（残菊逢霜）残菊逢霜，寂寞无碍，惨淡忧愁，晚景凄凉。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '家庭衰退，晚景凄凉。\r<BR>诗曰：废物灭亡不中用，一生惨淡贫困穷，忧苦乱离异端数，招致久病不起重。\r<BR>\r<BR>家庭衰退的晚景凄凉数。（凶）\r<BR>基业：官星，学士，文库，巧星，财库，破厄，劫禄。\r<BR>家庭：父母难当，兄弟无助，妻子宜尽。\r<BR>健康：病患，残疾，外伤，先天五行为金木者为健全。\r<BR>含义：险恶亡灭之象，一生惨淡，忧伤峭绝，有空虚寂寞之感，维免杀伤，残疾，刑罚，短命，离散等灾厄，不然便是世上无用之人。', '70');
INSERT INTO `sm_81` VALUES ('71', '（石上金花）石上金花，内心劳苦，贯彻始终，定可昌隆。', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）', '本应享天赋的幸福，但缺乏进取的勇气，故称吉凶参半数。\r<BR>诗曰：养神耐劳得安然，嫌力不足乏实行，片面幸福内麻烦，修身养德计事成。\r<BR>\r<BR>没有实质的磨神耐劳数。（半吉）\r<BR>基业：技艺，文昌，学士，破厄，劫禄。\r<BR>家庭：时有争执，宜守平和。\r<BR>健康：外伤，少些病患，三才善者安康。\r<BR>含义：备有生成的吉运，自应享受富贵福禄，无奈内心勒苦甚多，缺乏实行贯彻的精神，进取的勇气稀少致陷失败，故称吉凶参半的运数。', '71');
INSERT INTO `sm_81` VALUES ('72', '（无勇） 盛衰交加，徒有高志，天王福祉，终世平安。　', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）', '心比天高、命比纸薄，无大业可成，但大都可平安度日。\r<BR>诗曰：志高力微乏实行，妄谋无计事难成，晚年平安静逸祥，享得天赋增吉祥。\r<BR>\r<BR>志高力微的努力奋斗数。（半吉）\r<BR>基业：技艺、文昌、艺术、时禄、厄星、红艳。\r<BR>家庭：六亲无缘，夫妻旗鼓相当，难为儿女。\r<BR>健康：良好，须防阴病和眼疾。\r<BR>含义：盛衰交加之象，无实行贯彻之勇，徒有高志而无成事之能，然而天生福气，大都终世平安。', '72');
INSERT INTO `sm_81` VALUES ('73', '（残菊经霜）残菊经霜，秋叶寂寞，无能无智，辛苦繁多。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '无用之辈、衰叹命运。\r<BR>诗曰：沈沦逆境无智慧，徒衣徒食亦难然，老来不过难出世，一生非运叹人生。\r<BR>\r<BR>沉沦逆境的秋叶落寞数。（凶）\r<BR>基业：技艺、文昌、时禄、破厄、红艳、劫禄。\r<BR>家庭：妻子不知心，亲情无助，宜开朗心胸。\r<BR>健康：时遇伤残、病患、刑罚、短命，先天五行为土者安康自在。\r<BR>含义：无能无智、仅取得衣食，真世上无有之辈。县易生意外之灾，辛苦繁多，沉沦逆境，哀叹命运。', '73');
INSERT INTO `sm_81` VALUES ('74', '（残菊经霜）残菊经霜，秋叶寂寞，无能无智，辛苦繁多。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '无用之辈、衰叹命运。\r<BR>诗曰：沈沦逆境无智慧，徒衣徒食亦难然，老来不过难出世，一生非运叹人生。\r<BR>\r<BR>沉沦逆境的秋叶落寞数。（凶）\r<BR>基业：技艺、文昌、时禄、破厄、红艳、劫禄。\r<BR>家庭：妻子不知心，亲情无助，宜开朗心胸。\r<BR>健康：时遇伤残、病患、刑罚、短命，先天五行为土者安康自在。\r<BR>含义：无能无智、仅取得衣食，真世上无有之辈。县易生意外之灾，辛苦繁多，沉沦逆境，哀叹命运。', '74');
INSERT INTO `sm_81` VALUES ('75', '（退守） 退守保吉，发迹甚迟，虽有吉象，无谋难成。', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）', '守则平安，进则失败。\r<BR>诗曰：守则可安无忧事，龌龊失意害自私，妄进大败因所谓，总是宜静不宜动。\r<BR>\r<BR>守者可安，发迹甚迟数。（半吉）\r<BR>基业：将星、学士、时禄、破厄、灾动、文昌。\r<BR>家庭：可望圆满。\r<BR>健康：安康，三才不善者有病患。\r<BR>含义：虽有自然之吉相，无奈策划未成，若要做大事，便招失败痛苦，退过可保吉祥，进取必陷失意灾', '75');
INSERT INTO `sm_81` VALUES ('76', '（离散） 倾覆离散，骨肉分离，内外不和，虽劳无功。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '骨肉分离，内外不和，多病弱短命。\r<BR>诗曰：倾覆离散家破财，内外不和无可靠，家散丧妻悲愁限，贫病交迫寿又短。\r<BR>\r<BR>倾覆离散，虽劳无功数。（凶）\r<BR>基业：豪杰、文昌、将星、劫禄、破财。\r<BR>家庭：六亲无缘，夫妇分离，乏子息。\r<BR>健康：外伤、废疾、先天五行为金者平安。\r<BR>含义：内外不和，骨肉分离，逆境凶煞无限，倾家破产亡身的悲运数。故多病弱短命、妻子离愁。', '76');
INSERT INTO `sm_81` VALUES ('77', '（半吉） 家庭有悦，半吉半凶，能获援护，陷落不幸。　', '半吉', '次吉祥运（表示多少有些障碍，但能获得吉运）', '前半生幸福便后半生不幸；后半生幸福便前半生不幸。\r<BR>诗曰：乐极生悲吉与凶，长上余德福禄强，前佳后劣悲叹运，半身劳尽终吉祥。\r<BR>\r<BR>家庭有悦的半凶半吉数。（半吉）\r<BR>基业：将星、财帛、劫禄、破厄。\r<BR>家庭：六亲不得力，子息宜迟。\r<BR>健康：须防肺病，先天五行为土得平安。\r<BR>含义：多获上级援护，幸福享至中年，然后陷落不平，悲叹灾厄，如果有悲运于前半生者，后半生却反得吉祥。', '77');
INSERT INTO `sm_81` VALUES ('78', '（晚苦） 祸福参半，先天智能，中年发达，晚景困苦。　', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '晚景凄凉，功德渐败。\r<BR>诗曰：晚境凄伧相侵生，中年渐渐发达来，晚年困苦逢秋冷，难免守居得安然。\r<BR>\r<BR>晚境凄凉的功德光荣数。（凶）\r<BR>基业：将星、学士、技艺、破厄、劫财、突破。\r<BR>家庭：亲缘少，兄弟疏，宜多联络。\r<BR>健康：宜防呼吸病，负伤、遭难，先天五行为水土者，可望健全。\r<BR>含义：福祸虽有参半，凶相较多一些，天生智能齐备，是以中年以前成功发达，乃至中年后，渐自衰退，陷于困苦、大悲惨的暗示。', '78');
INSERT INTO `sm_81` VALUES ('79', '（云头望月）云头望月，身疲力尽，穷迫不伸，精神不定。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '精神不安，为世所弃。\r<BR>诗曰：挽回乏力无善谋，精神不定如云黑，失节丧信无所至，受人评击却责难。\r<BR>\r<BR>挽回乏力的身疲力尽数。（凶）\r<BR>基业：将星、学士、时禄、破厄、灾厄、文昌、劫财。\r<BR>家庭：亲眷疏、兄弟不和，凡事谨慎则平安。\r<BR>健康：外伤、病患，先天五行为金木者可望安全。\r<BR>含义：穷迫不伸的逆境，精神不定，缺乏实行的能力，乏贞节，失信用，受攻击非难，为世所弃，成个废人，但身体却健康。', '79');
INSERT INTO `sm_81` VALUES ('80', '（遁吉） 辛苦不绝，早入隐遁，安心立命，化凶转吉。', '凶', '凶数运（表示逆境、沉浮、薄弱、病难、困难、多灾等）', '一生困难辛，夭折者多，但早入隐遁的生活，可安心立命。\r<BR>诗曰：吉星入遁多波浪，覆之一数正安乐，幸福遁来富贵儿，名扬四海吉祥余。\r<BR>\r<BR>凶星入度的清本缩小数。（凶）\r<BR>基业：将星、技艺、学者、时禄、破财、灾厄。\r<BR>家庭：家中口舌多，不可多言。\r<BR>健康：病患多，三才善者可望平安。\r<BR>含义：一生困难辛苦不绝，病患、刑伤、夭折者多，但早入隐遁的生活者，可以安心立命，化凶转吉。', '80');
INSERT INTO `sm_81` VALUES ('81', '（万物回春）最吉之数，还本归元，吉祥重叠，富贵尊荣。', '大吉', '吉祥运（表示健全、幸福、名誉等）', '还原复始之最大吉之数。好运之巅峰。\r<BR>诗曰：还元复始重临福，九九八一还本元，八二之数与二灵，此诀玄理覆数传。\r<BR>\r<BR>万物回春，还原复始的积极盛大数。（大吉）\r<BR>基业：天福、天官、赐禄、财库、将星、技艺、文昌。\r<BR>家庭：子女俱佳，兄弟圆满，家庭和睦。\r<BR>健康：身心健全，可望长寿，三才不善者可能病患。\r<BR>含义：最极之数，还本归元，属于体力旺盛，庆幸万多，吉祥重叠，富贵尊荣的大诱导之数。', '81');
INSERT INTO `sm_81` VALUES ('999', '（七政之数）七政之数，精悍严谨，天赋之力，吉星照耀。　', 'ba', '吉祥运（表示健全、幸福、名誉等）\r\n<BR>刚情运（性刚固执、意气用事）', '还原复始之最大吉之数。好运之巅峰。\r\n<BR>诗曰：还元复始重临福，九九八一还本元，八二之数与二灵，此诀玄理覆数传。\r\n<BR>\r\n<BR>万物回春，还原复始的积极盛大数。（大吉）\r\n<BR>基业：天福、天官、赐禄、财库、将星、技艺、文昌。\r\n<BR>家庭：子女俱佳，兄弟圆满，家庭和睦。\r\n<BR>健康：身心健全，可望长寿，三才不善者可能病患。\r\n<BR>含义：最极之数，还本归元，属于体力旺盛，庆幸万多，吉祥重叠，富贵尊荣的大诱导之数。', '82');
