INSERT INTO `sm_hzwh` VALUES ('土', '又\r一乙己山土丸兀丫也尢于厄切王?夭尹引尤友予曰允凹瓦戊矽央以永用由右幼孕仔吖安充地圪艮圭灰圾岌圮屺戍似吐圩仵伍戌伢羊伊衣圯夷亦屹因有宇羽圳岙岜坂坌辰坊坩均坎坑牡圻岐岍坍秃完位圬氙岘呀岈延冶矣佚役邑吲甬攸卣佑余欤?址艾坳?坻坫矾附矸岣岵岬坷岢坤垃峁岷坭爬帕?坯坪坡坦坨宛往旺委忤岫盱亚奄肴夜依抑佾咏呦侑於盂臾昀狁\r文章引用自：\r哀?拗砭?衩昶垤垌峒肚砘垛垩垡垓垢砍奎趴怕盆砒垧哇娃威韦畏胃瓮屋侮型砉峋押垭娅砑咽?怏?姚要咿怡咦姨舣姻音垠俑勇幽疣?囿宥纡舁禹垣爰约?窀\r啊唉埃砹鹌俺按案盎敖??城埕砥峨恩砝砩个埂埚砬埒埋砰破埔砌峭窃容埏砷堍砣娓翁唔阢峡轩蚜氩恹胭宴晏氧恙眙酏益殷氤蚓?迂?育?眢员袁砸砟砧肫\r挨庵?埯崩埠?埭岽硐堆岗硌崮硅崞胡基崛崆堀崃硭埝鸟啪培堋埤崎畦牵眭堂窕眺婉唯帷伟尉迕捂牾硒崤硎勖琊崖哑讶迓崦焉偃痒野痍移异埸翌狺寅迎茔庸恿悠蚰蚴狳域欲峥埴蛭\r捱???胺媪傲?堡??砗堤奠堞恶费黑堠画黄堪喹岚塄嵋垴蛙崴为围帏惟喂硪婺痦翕硖翔硝砚堰揶掖猗壹诒迤贻胰喑堙喁釉嵛鼋粤越崽跖\r阿矮爱嗌揞暗嗷?廒奥碑碚碘碉碇碓痱话?嵴碱垲块跬袅硼圣嵊嵩塑碎塌塘填琬碗嵬猥痿艉猬温嗡握呜蜈坞诩勋埙睚衙揠蜒爷揖饴诣意裔饮佣雍蛹犹猷瘀园圆援塬氲恽晕愠轾稚嵫\r肮獒?碥碴?诞碲垫碟砜闺监碣境逵?墚嵝墁呕碰堑岖墒塾墅硕碳维玮诬误寤瑕鞋顼嘘墟碹腌嫣耶腋?旖夤瑛墉踊诱与鸢冤猿殒翟崭嶂坠准\r?鞍????墀磁磋嶝墩堕废坟磙嘿糊蝴峤磕蝰崂磊嶙碾嬲欧殴怄磐?确豌纬诿卫慰庑娴糈鸦养噎叶靥亿逸影慵忧邮鱿蝣牖谀缘院阅增磔嗳嫒谙聱螯懊磅壁碜惯衡垦垮磨瓯碛墙融坛违谓怃歙遐鸭阉燕噫颐峄殪阴壅馀豫鸳螈运郓酝砖癌隘???遨?磴礅鲑壕壑磺矶礁圹岭硗嵘闱鲔邬压阳嶷忆怿翳应婴膺拥优黝隅屿辕远龠郧\r碍瑷?袄蹦璧础礓垒讴韪鄢医黟彝癔鄞?鼬陨韫?礤坏疆坜垄垆稳鹉骛臆臃韵骜?矿岿砾壤鼯鹜邺瘾嘤罂鳌礴蠡砺砻碌礞巍撄誉跃巅峦鸥懿隐璎鳙饔娈岩缨坝罐盐艳呓鹦鹳', '又\r\n一乙己山土丸兀丫也尢于厄切王?夭尹引尤友予曰允凹瓦戊矽央以永用由右幼孕仔吖安充地圪艮圭灰圾岌圮屺戍似吐圩仵伍戌伢羊伊衣圯夷亦屹因有宇羽圳岙岜坂坌辰坊坩均坎坑牡圻岐岍坍秃完位圬氙岘呀岈延冶矣佚役邑吲甬攸卣佑余欤?址艾坳?坻坫矾附矸岣岵岬坷岢坤垃峁岷坭爬帕?坯坪坡坦坨宛往旺委忤岫盱亚奄肴夜依抑佾咏呦侑於盂臾昀狁\r\n文章引用自：\r\n哀?拗砭?衩昶垤垌峒肚砘垛垩垡垓垢砍奎趴怕盆砒垧哇娃威韦畏胃瓮屋侮型砉峋押垭娅砑咽?怏?姚要咿怡咦姨舣姻音垠俑勇幽疣?囿宥纡舁禹垣爰约?窀\r\n啊唉埃砹鹌俺按案盎敖??城埕砥峨恩砝砩个埂埚砬埒埋砰破埔砌峭窃容埏砷堍砣娓翁唔阢峡轩蚜氩恹胭宴晏氧恙眙酏益殷氤蚓?迂?育?眢员袁砸砟砧肫\r\n挨庵?埯崩埠?埭岽硐堆岗硌崮硅崞胡基崛崆堀崃硭埝鸟啪培堋埤崎畦牵眭堂窕眺婉唯帷伟尉迕捂牾硒崤硎勖琊崖哑讶迓崦焉偃痒野痍移异埸翌狺寅迎茔庸恿悠蚰蚴狳域欲峥埴蛭\r\n捱???胺媪傲?堡??砗堤奠堞恶费黑堠画黄堪喹岚塄嵋垴蛙崴为围帏惟喂硪婺痦翕硖翔硝砚堰揶掖猗壹诒迤贻胰喑堙喁釉嵛鼋粤越崽跖\r\n阿矮爱嗌揞暗嗷?廒奥碑碚碘碉碇碓痱话?嵴碱垲块跬袅硼圣嵊嵩塑碎塌塘填琬碗嵬猥痿艉猬温嗡握呜蜈坞诩勋埙睚衙揠蜒爷揖饴诣意裔饮佣雍蛹犹猷瘀园圆援塬氲恽晕愠轾稚嵫\r\n肮獒?碥碴?诞碲垫碟砜闺监碣境逵?墚嵝墁呕碰堑岖墒塾墅硕碳维玮诬误寤瑕鞋顼嘘墟碹腌嫣耶腋?旖夤瑛墉踊诱与鸢冤猿殒翟崭嶂坠准\r\n?鞍????墀磁磋嶝墩堕废坟磙嘿糊蝴峤磕蝰崂磊嶙碾嬲欧殴怄磐?确豌纬诿卫慰庑娴糈鸦养噎叶靥亿逸影慵忧邮鱿蝣牖谀缘院阅增磔嗳嫒谙聱螯懊磅壁碜惯衡垦垮磨瓯碛墙融坛违谓怃歙遐鸭阉燕噫颐峄殪阴壅馀豫鸳螈运郓酝砖癌隘???遨?磴礅鲑壕壑磺矶礁圹岭硗嵘闱鲔邬压阳嶷忆怿翳应婴膺拥优黝隅屿辕远龠郧\r\n碍瑷?袄蹦璧础礓垒讴韪鄢医黟彝癔鄞?鼬陨韫?礤坏疆坜垄垆稳鹉骛臆臃韵骜?矿岿砾壤鼯鹜邺瘾嘤罂鳌礴蠡砺砻碌礞巍撄誉跃巅峦鸥懿隐璎鳙饔娈岩缨坝罐盐艳呓鹦鹳');
