INSERT INTO `users_purview_config` VALUES ('purview_xml', '<pools:admin name=\"管理员\" allowpool=\"member\" auttype=\"cookies\" login_control=\"?ct=index&ac=login\">\n\n    <!-- //公开的控制器，不需登录就能访问 -->\n    <ctl:public>index-login,index-loginout</ctl:public>\n\n    <!-- //保护的控制器，当前池会员登录后都能访问 -->\n    <ctl:protected>index-index,index-adminmsg,users-mypurview</ctl:protected>\n\n    <!-- //私有控制器，只有特定组才能访问 -->\n    <ctl:private>\n        <admin name=\"管理员\">*</admin>\n        <test name=\"分销代理\">index-*,users-editpwd,fxdl-index,fxdl-links,fxdltxzh-*</test>\n    </ctl:private>\n\n</pools:admin>\n\n<pools:member name=\"网站会员\" allowpool=\"\" auttype=\"cookie\" login_control=\"?ct=index&ac=login\">\n\n    <!-- //公开的控制器，不需登录就能访问 -->\n    <ctl:public>index-login,index-loginout,index-register,index-get_password,index-validate_image,index-test_user_name,index-test_email</ctl:public>\n\n    <!-- //保护的控制器，当前池会员登录后都能访问 -->\n    <ctl:protected>index-index</ctl:protected>\n\n    <!-- //私有控制器，只有特定组才能访问 -->\n    <ctl:private>\n        <normal name=\"普通会员\">*</normal>\n    </ctl:private>\n\n</pools:member>\n\n');
